import React from 'react';
import MovieList from './movies';
import Podcasts from './podcasts';

function NavBar() {
  return (
    <nav className="navBar">
      <ul>
        <li>
          <a href="./index">Home</a>
        </li>
        <li>
          <button onClick={MovieList}>Movies</button>
        </li>
        <li>
          <button onClick={Podcasts}>Podcasts</button>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
